import React from 'react'
import ToDo from './ToDo'
const ToDoList = ({tasks, match}) => {
    var filterdTasks
    switch(match.params.filter){
        case 'completed':
            filterdTasks = tasks.filter(task => task.completed)
        break;
        default:
            filterdTasks = tasks
    }
    return(
    <>
        <h1 className="m-3">Liste de t√¢ches</h1>
        <ul className="list-group m-3">
            {
                filterdTasks.map((task)=> <ToDo task={task} key={task.id}/>)
            }
        </ul>
    </>
    )
}

export default ToDoList
